import React from 'react';

class RestaurantItem extends React.Component {
    constructor(props) {
        debugger
        super(props);
    }

    render() {
        const address = `${this.props.address}, ${this.props.city} ${this.props.state}, ${this.props.postal_code}`;
        return (
            <li key={this.props.id} className="">
                <img src={this.props.image_url} />
                <div>{this.props.name}</div>
                <div>{address}</div>
                <div>{this.props.price}</div>
            </li>
        )
    }
}

export default RestaurantItem;
